import React from 'react'
import {useLocation} from 'react-router-dom';


const Home = () => {

const location = useLocation()

  return (
    <div className='home'>
       <h2>
        Home Page { location.pathname}
      </h2>
      <button 
      onClick={()=> navigate('/about')}
      className='btn_css'>
        Go About
      </button>
    </div>
  )
}

export default Home
